import React from "react";
// import { Link } from 'react-router-dom'
import {
  Card,
  Box,
  Image,
  Stack,
  Heading,
  Container,
  Columns,
  Text,
  Paragraph,
  Badge,
} from "bumbag";

import { Moon, Sun } from "react-feather";

const NavBar = () => (
  <Container paddingY="2rem">
    <Columns>
      <Columns.Column spreadMobile={6} spread={6}>
        <Heading use="h4">DAVI</Heading>
      </Columns.Column>
      <Columns.Column spreadMobile={6} spread={3}>
        <Moon color="#5863D8"></Moon>
      </Columns.Column>
    </Columns>
  </Container>
);

export default NavBar;
